import React from 'react';
import './style.css';


/**
 * @author
 * @function Navbar
 **/


 const Navbar = (props)=>{
     return(
        <div className="navbar">
            <ul className="navbarMenu">
                <li><a>Home</a></li>

            </ul>
        </div>
     );
 }

 export default Navbar;
